sap.ui.define(["sap/ui/core/mvc/Controller",
"sap/m/MessageToast"], function(Controller, MessageToast) {
	"use strict";
	return Controller.extend("QuickStartApplication.controller.View1", {
		/**
		 *@memberOf QuickStartApplication.controller.View1
		 */
		onPress: function(oEvent) {
			//This code was generated by the layout editor.
			var path = oEvent.getSource().getBindingContextPath();
			var url = this.getView().getModel().getObject(path);
			window.open(url.URL);

		}
	});
});